import React from 'react';
import styled from 'styled-components';
import Fade from 'react-reveal/Fade';
import { Image } from 'react-bootstrap';
import LoadingPNG from '../assets/wave.png';
const Styles = styled.div`
  #loading-container {
    display: flex;
    justify-content: center;
    align-items: center;
    background: white;
    height: 100vh;
    width: 100vw;
    position: fixed;
    top: 0;
    left: 0;
    z-index: 5;
  }

  img {
    height: 20vw;
    width: 25vw;
  }
`;

const Loading = () =>  (
      <Styles>
        <div id="loading-container">
          <Image src={ LoadingPNG } />
        </div>
      </Styles>
  );

export default Loading;
